import React from 'react';

function User({ user }){

    return (
        <div>
            <b>{user.userName}  <span>({user.userName})</span></b>
        </div>
    )
}

function UserList(){
    const users = [
        {
            id: 1,
            userName: 'j0dev',
            email: 'asdf@asdf.com'

        },
        {
            id: 2,
            userName: 'intadd',
            email: 'qwer@asdf.com'

        },
        {
            id: 3,
            userName: 'test',
            email: 'zxcv@asdf.com'

        }

    ];
    return (
        <div>
            {
                users.map(
                    user => (<User user={user} key={user.id}/>)
                )
            }
        </div>
    ) 
}



export default UserList;
